import React, { useState, useEffect } from 'react';

interface CandidateDatabaseProps {
  socket: WebSocket | null;
  sendMessage: (message: string) => void;
  isConnected: boolean;
}

const CandidateDatabase: React.FC<CandidateDatabaseProps> = ({ socket, sendMessage, isConnected }) => {
  const [candidates, setCandidates] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    // Mock candidate data
    setCandidates([
      { id: 1, name: 'John Doe', skills: ['React', 'Node.js'], experience: 5, status: 'available' },
      { id: 2, name: 'Jane Smith', skills: ['Python', 'Django'], experience: 3, status: 'interviewing' },
      { id: 3, name: 'Mike Johnson', skills: ['Java', 'Spring'], experience: 7, status: 'available' }
    ]);
  }, []);

  return (
    <div>
      <h2>ðŸ‘¥ Candidate Database</h2>
      <p>Browse and manage your talent pool</p>
      
      <div className="form-group">
        <input
          type="text"
          placeholder="Search candidates..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="form-input"
        />
      </div>
      
      <div className="stats-grid">
        {candidates.map((candidate: any) => (
          <div key={candidate.id} className="stat-card">
            <h3>{candidate.name}</h3>
            <p>Skills: {candidate.skills.join(', ')}</p>
            <p>Experience: {candidate.experience} years</p>
            <span className={`status ${candidate.status}`}>{candidate.status}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CandidateDatabase;
